			var $yeaList;
			var $nayList;
			
			var $wordCloud = {};
			
			$(document).ready(function(){
			
				var $highest = 0;                        
				$.each(data, function(key, value) 
				{ 
					$wordCloud[key] = 0;
					
					var yeaCount = 0;
					var nayCount = 0;             
					$.each(value.yea, function(voter, sum) 
					{ 
						yeaCount += sum[1];
						//$wordCloud[key] += sum[1];
					});
					$.each(value.nay, function(voter, sum)
					{
						nayCount += sum[1];
					});
					
					$wordCloud[key] += yeaCount;// + nayCount;// Math.max(yeaCount, nayCount);
					
					$highest = Math.max($wordCloud[key], $highest);
				});
				
				$cloudList = $("#wordCloud ul.cloud");
				// Create items array
				
				var items = Object.keys($wordCloud).map(function(key) {
					return [key, $wordCloud[key]];
				});

				// Sort the array based on the second element
				items.sort(function(first, second) {
					return second[1] - first[1];
				});
				
				//$.each($wordCloud, 
				$.each(items, 
					function(key, result)
					{
						var percSize = Math.trunc(100 * (result[1]/$highest));
						var size = 100;
						var color = "ff0000";
						if(percSize > 70)
						{
							color = "00ff00";
							size = 74;
						}else if(percSize > 30){
							color = "0000ff";
							size = 62;
						}else {
							color = "00ffff";
							size = 20;
						}
						$cloudList.append('<li><span id="'+result[0]+'" style="font-size:'+size+'px">'+result[0]+'</span></li>');
					}
				);
				
				$yeaList = $('#yeas ul.voters');
				$nayList = $('#nays ul.voters');
				
				$yeaList.parent().hide();
				$nayList.parent().hide();
				
				$("#wordCloud li span").click(onTermSelected);
				
				var stickyRibbonTop = $('#stickyribbon').offset().top;
          
				$(window).scroll(function(){
						if( $(window).scrollTop() > stickyRibbonTop ) {
								$('#stickyribbon').css({position: 'fixed', top: '0px'});
						} else {
								$('#stickyribbon').css({position: 'static', top: '0px'});
						}
				});

				
			});


			
			function onTermSelected()
			{
				
				var $term = this.id;
				var $yeas = data[$term].yea;
				var $nays = data[$term].nay;
				
				$("#selectedTerm").text($term);
				
				$yeaList.find('li').remove();  
				
				$.each($yeas, function(key, value) 
				{
					$yeaList.append('<li>' + value[0] + ' (' + value[1] + ')</li>');
				});
				
				$nayList.find('li').remove();
				
				$.each($nays, function(key, value)
				{
					$nayList.append('<li>' + value[0] + ' (' + value[1] + ')</li>');
				});
				
				$yeaList.parent().show();
				$nayList.parent().show();
			}
